import groovy.json.JsonSlurper

                        def testStep = testRunner.testCase.getTestStepByName("Request 0")
                        def ResponseMessage = testStep.testRequest.response.responseContent
                        def ParsedMessage = new JsonSlurper().parseText(ResponseMessage)
                        assert !(ParsedMessage.isEmpty())
                        def count = ParsedMessage.body.data.size()
                        log.info count
                        testRunner.testCase.setPropertyValue("totalCount", count.toString());
                        testRunner.testCase.setPropertyValue("loop.i", count.toString());

def list = testRunner.testCase.getPropertyValue("physicianIds")
                        list = list.replace("[", "").replace("]", "").replace(" ", "")
                        list = list.tokenize(',')

                        def list2 = testRunner.testCase.getPropertyValue("physicianIds.existingCtms")
                        list2 = list2.replace("[", "").replace("]", "").replace(" ", "")
                        list2 = list2.tokenize(',')

                        def i = Integer.parseInt(testRunner.testCase.getPropertyValue("loop.i"))
                        --i

                        log.info list[i]
                        testRunner.testCase.getTestStepByName("POST Request - 200").setPropertyValue("physicianId", list[i])
                        testRunner.testCase.getTestStepByName("POST Request - 409").setPropertyValue("physicianId", list[i])

                        testRunner.testCase.setPropertyValue("loop.i", i.toString())

                        // Skip iteration if physician already invited to user's care team
                        if (list2.contains(list[i])) {
                        log.info "skip iteration for id=" + list[i]
                        testRunner.gotoStepByName("Conditional Goto (end loop?)")
                        }

