import groovy.json.JsonSlurper
                        import static com.jayway.jsonpath.JsonPath.parse

                        def testStep = testRunner.testCase.getTestStepByName("Request 0")
                        def ResponseMessage = testStep.testRequest.response.responseContent
                        def ParsedMessage = new JsonSlurper().parseText(ResponseMessage)
                        assert !(ParsedMessage.isEmpty())

                        def json = ParsedMessage.body.data
                        def currentProviders = parse(json).read('[?(@.current==true)].residentId')
                        if (currentProviders.size() > 1) {
                        testRunner.testCase.setPropertyValue("residentId.original", "0");
                        } else if (currentProviders.size() == 1) {
                        testRunner.testCase.setPropertyValue("residentId.original", currentProviders[0]);
                        } else {
                        testRunner.testCase.setPropertyValue("residentId.original", null);
                        }

